import React from "react";
import Home from "./Components/Home";
import {Route , Routes} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/">
          <Home />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
